:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Herbert William and MASON, Bertha Louisa Gertrude
  JWILLIAMS, Denys William Wanklyn and THOMSON, Margaret Ann
  JWILLIAMS, Christine Louise (Kirsty) and BURBURY, Duncan Edward
  JBURBURY, Kathleen Mary (Kate) and HOLDEN, Warren Lyall.
  03> BURBURY, Kathleen Mary (Kate) m on 23.03.1985 to HOLDEN, Warren Lyall
  b 04.09.1955
  b 30.07.1946
  Kathleen b. at Hastings and m, at Havelock North. Warren, s/o Sidney Eric
  Holden and Elsie Rountree. Address: 892 Park Road South, Hastings,
  Kate was educated at Queenswood Rudolf Steiner School in Hastings and St
  Mary's School in Stratford and graduated BA and DipTchg from Victoria
  University and the Wellington College of Education. She is a primary
  school teacher and has worked for the Palmerston North College of
  Education as a lecturer and music advisor, and set up a keyboard music tuition programme in Hawkes
  Bay schools. She plays the violin in the Hawkes Bay Regional Orchestra and the Hastings
  Sinfonietta. Kate is president of the Hawkes Bay Regional Orchestra, vice-president of the Hawkes
  Bay Orchestral Society and a member of the Hawkes Bay Society for Music Education Committee. She
  has sat on the Hastings Hillary Commission and Creative New Zealand funding distribution
  committees. She is actively involved in promoting music education and is at present working on
  music programmes with the elderly and babies.
  Warren was educated in Foxton and is a trained sheetmetal engineer and presently works for the
  Hawkes Bay EIT as a horticultural technician. He is a keen sportsman and is involved in local
  tennis and cricket clubs.
  01> HOLDEN, Jack Sidney Duncan
  b 24.01.1998
  Jack b. at Hastings. He was the youngest descendant to attend the 175th Williams Family
  Reunion in 1998, being three months old at the time.
  04> BURBURY, Amy Margaret m on 24.10.1981 to McGLASHEN, Colin
  b 29.08.1957
  b 08.07.1953
  Amy b. at Hastings and m, at Havelock North. Colin, s/o Donal James McGlashen and Gaie Hamill, b.
  at Whakatane. Address: 15 PO Box 85, Whakatane.
  Amy graduated as an occupational therapist (1977). She is currently working with primary school
  children who have special needs.
  Colin qualified in accountancy in 1977 and is now a business manager.
  01> MCGLASHEN, John Richard
  b 13.03.1986
  John b. at Whakatane.
  02> McGLASHEN, Hamish Ralph
  b 19.10.1988
  Hamish b. at Whakatane.
  03> WILLIAMS, Adrian Herbert m on 07.09.1957 to BUSBY, Elizabeth Anne
  b 10.05.1930
  b 09.07.1936
  Adrian b. and m, at Gisborne. Anne, d/o James Busby and Winifred Mary Cullwick, b. at Gisborne.
  Address: Nobhill, PO Box 3060, Gisborne.
  Adrian was educated at St George's School and Wanganui Collegiate School (1944-47). He farmed on
  "Ruangarehu" station at Tokomaru Bay from 1955 to 1990 then retired to Gisborne. He served on the
  Waiapu County Council from 1971 to 1989. Anne was a trained dental nurse.
